import React from "react"
import Forms from "./forms"
import Axios from "axios"
import ReactDOM from "react-dom"

function App(){
 
    const go = function(){
        window.open("http://localhost:1000/forms")
    }
    return(
        <div>
            <button onClick = {go}>Click</button>
        </div>
    )
} 



export default App
